window.bookSummaryJSON = "<p>Ten strangers trapped in time.... </p> <p>A ticking sound fills the air as Tim MacGregor enters The Daily Edition Café, hoping to meet his new girlfriend for coffee. Moments later, the café is transported 67 million years into the past, along with everyone inside. </p> <p>Time is running out as 10 unlikely companions search for a way home, while one member of the group plots to keep them all trapped in the past. </p> <p>Who will survive? </p> <p>This unabridged production of <i>The Dinosaur Four</i> is performed by Nick Podehl, award-winning narrator of the Chaos Walking trilogy and The Kingkiller Chronicles series. </p> <p><i>The Dinosaur Four</i> contains violence, profanity, and adult themes. </p>"; 
